import Project from "@/components/Project";

import styles from "./page.module.css";
import { PROJECTS, TECHS, INTRO } from "@data";
import NextLink from "next/link";
import Link from "@/components/Link";

const TECH_CATEGORIES = [
  "language",
  "frontend",
  "backend",
  "testing",
  "documentation",
  "others",
];
export default function Home() {
  return (
    <main>
      <section className={styles["main-section"]} id="contact">
        <article className={styles["introduction"]}>
          <h1 className={styles["title"]}>
            {INTRO.title}
            <br />
            <span className={styles["subtitle"]}>{INTRO.subtitle}</span>
          </h1>
          <p className="profile">{INTRO.text}</p>
          <div className={styles["contact-links"]}>
            {INTRO.socials.map((social, i) => (
              <a
                key={social.href}
                className={`button-link ${i > 0 ? "button-secondary" : ""}`}
                href={social.href}
                target="_blank"
                rel="noreferrer"
              >
                {social.name} <SocialIcon name={social.name} />
              </a>
            ))}
          </div>
        </article>
        <article className={styles["illustration"]}>
          <Avatar />
        </article>
      </section>
      <section>
        <h2 id="projects">Projects</h2>
        <div className={styles["projects"]}>
          {PROJECTS.map((project, index) => (
            <NextLink
              href={"/project/" + project.slug}
              key={project.id}
              className="link-box"
            >
              <Project
                data={{
                  id: project.id,
                  title: project.title,
                  subtitle: project.subtitle,
                  logo: project.icon,
                  slug: project.slug,
                  summary: project.summary,
                }}
              />
            </NextLink>
          ))}
        </div>
      </section>
      <section>
        <h2 id="technologies">Technologies</h2>
        <div className={styles["techs"]}>
          {TECH_CATEGORIES.map((category) => (
            <article className="tech-category" key={category}>
              <h3 className={styles["tech-category-name"]}>{category}</h3>
              <ul className={styles["tech-list"]}>
                {TECHS.map(
                  (tech) =>
                    tech.category === category && (
                      <li key={tech.name} className="link">
                        <Link external={true} href={tech.resource_url}>
                          {tech.name}
                        </Link>
                      </li>
                    ),
                )}
              </ul>
            </article>
          ))}
        </div>
      </section>
    </main>
  );
}

